import React from 'react';
import './Sidebar.css';

const profiles = [
  { id: 1, name: 'John' },
  { id: 2, name: 'Alice' },
  { id: 3, name: 'Bob' },
  // Add more profiles as needed
];

function Sidebar({ onSelectProfile }) {
  return (
    <div className="Sidebar">
      <h2>Chats</h2>
      <ul>
        {profiles.map((profile) => (
          <li key={profile.id}>
            <button onClick={() => onSelectProfile(profile)}>{profile.name}</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Sidebar;
